import React from "react";
import "./Header.css"
import logo from "./ddulogo.JPG"

function Header() {
  return (
    <>
      <ul>
        <li>
          <img src={logo} alt="DDU logo" 
          style={{height:'50px', width: '50px', position: 'relative',left:'0px', top:'0px'}} /> 
        </li>
        <li style={{position: 'relative', left:'100px', fontSize:''}}>
            Welcome to DDU Event Horizon!
        </li>
      </ul>
    </>
  );
}

export default Header;
